  - id: 9
    name: Search FEM-STUDY Study Subject
    description: "Search subjects by name, phone, email, city, zip or FEM-STUDY ID.\r\nLeave
      the search field empty to see all subjects."
    sql: "select distinct m.id master_id, \r\npi.first_name, pi.middle_name, pi.last_name,
      pi.nick_name,\r\na.street, a.street2, a.city, a.state, a.zip, \r\npc.data, pc.rec_type\r\nfrom
      masters m\r\nleft join fem_assignments b\r\non m.id = b.master_id\r\ninner join
      fem_subjects pi\r\non pi.master_id = m.id \r\nleft join fem_addresses a\r\non
      m.id = a.master_id\r\nleft join fem_contacts pc\r\non pc.master_id = m.id\r\nwhere
      \r\n(:name is null \r\nor pi.first_name ~* :name\r\nor pi.last_name ~* :name\r\nor
      pi.middle_name ~* :name\r\nor pi.nick_name ~* :name\r\nor( \r\n    pi.first_name
      ~* coalesce(split_part(:name, ' ', 1),'none')\r\n    AND pi.last_name ~* coalesce(split_part(:name,
      ' ', 2),'none')\r\n  )\r\n) \r\nor regexp_replace(pc.data, '\\W+', '', 'g')
      ~* regexp_replace(:name, '\\W+', '', 'g')\r\nor b.fem_id::varchar = :name\r\nor
      a.city = :name\r\nor a.zip = :name"
    search_attrs: "name: \r\n  text: \r\n    all: true\r\n    multiple: single\r\n"
    admin_id: 2
